import React from 'react';
import './styles/style.css'; // Import des styles globaux
import './styles/square.css'; // Import des styles spécifiques
import './styles/neon.css'; // Import des styles spécifiques
import Header from './components/Header';
import Content from './components/Content';
import Footer from './components/Footer';

function App() {
  return (
    <div className="bg-dark text-light">
      <div className="square"></div>
      <Header />
      <Content />
      <Footer />
    </div>
  );
}

export default App;
